import React from 'react'
import { AiOutlineSearch } from 'react-icons/ai'

const NavSearch = () => {
    return(
    <div>
        <form>
            <input type="text" placeholder="Search" style={navSearch_style}/>
            <AiOutlineSearch style={search_btn}/>
        </form>
    </div>
    );
}

const navSearch_style = {
    height: "5vh",
    width: "70%",
    marginTop: "1vh",
    borderRadius: "10px",
    fontSize: "2vh"
}

const search_btn = {
    height: "4vh",
    width: "20%"
}

export default NavSearch
